import React from "react";
// Components
import "./News.css";
import image1 from '../../image/gift.png'
import {Container, Row, Col, CardBody} from 'reactstrap'
import ReactPlayer from "react-player";
import Card from "react-bootstrap/Card";


const News = () => (

    <div className="w-responsive text-center mx-auto p-3 mt-2">
        <Card style={{ width: '18rem' }}>
            <img src={image1} alt=" gift_photo " style={{ float : "left"}}/>
            <CardBody style={{ float : "right"}}>
                <Card.Title>Taking Your GDG Gift</Card.Title>
                <Card.Text>If you join GDG online talk you can get a gift</Card.Text>
                <Card.Text>Date: 28 Oct 2020
                    Time: 0830-1530
                    Venue: 3/F staff office,LWL
                    Abstract: ...</Card.Text>
                <Card.Text>* If you get a luckydraw gift, please tell us your name of the gift. Here is GDG channel:
                    <a href="https://www.youtube.com/watch?v=YLOxkSvIu2s&ab_channel=GDGCloudHK"></a>
                </Card.Text>
            </CardBody>
        </Card>
    </div>
)
;

export default News;
